// SPDX-License-Identifier: MIT
pragma solidity ^0.8.13;
import './proxy/OwnableMutableProxy.sol';
import './EternalStorage.sol';

contract FrontDoor is OwnableMutableProxy {
  uint256 public constant ETERNAL_STORAGE_ADDRESS_SLOT = 0xedd85ae326febb54e962a94ad0a00fc5f34b30b69695966833f1a8e505211d5f; // keccak256('eternalStorage')
  uint256 public constant FRONTDOOR_ADDRESS_SLOT = 0x618f1bc4c8f4f99ac8b24d512c92dce5a12e4aa22a9c655d2dcb3c77e17941e7; // keccak256('frontDoor')

  constructor() {
    EternalStorage eternalStorage = new EternalStorage();
    address eternalStorageAddress = address(eternalStorage);
    address thisAddress = address(this);
    assembly {
       sstore(IS_USERPROXY_SLOT, false)
      //  sstore(FRONTDOOR_ADDRESS_SLOT, thisAddress)
      //  sstore(ETERNAL_STORAGE_ADDRESS_SLOT, eternalStorageAddress)
    }
    assembly {
       sstore(FRONTDOOR_ADDRESS_SLOT, thisAddress)
    }
    assembly {
       sstore(ETERNAL_STORAGE_ADDRESS_SLOT, eternalStorageAddress)
    }
  }

  function getFrontDoorAddress() public view returns (address x) {
    assembly {
      x := sload(FRONTDOOR_ADDRESS_SLOT)
    }
  }

  function getEternalStorageAddress() public view returns (address x) {
    assembly {
      x := sload(ETERNAL_STORAGE_ADDRESS_SLOT)
    }
  }
}
